import React, {useState} from 'react'

export const Counter = () => {

const plsHandler = (e)=>{

    const [prevState, setprevState] = useState(0)
    console.log('Add');
    prevState +=1
    console.log(prevState);
}

  return (
    <div>
        <h2>Counter</h2>
        <p>{prevState}</p>
        <button onClick={plsHandler}>+</button>
        <button>-</button>
    </div>
    
  )
}
